  [],\n\t\"revision_timestamp\": \"2015-05-07T03:43:26.294086\",\n\t\"name\": \"advanced-silicone-based-coatings-for-flexible-fabric-applications-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"High performance silicone coatings are desired
  for flexible fabrics used in several space and consumer applications.  For instance,
  the total weight of silicone coatings that are used on Mars Exploration Rovers (MER)
  airbags can be reduced by improving their thermal stability and mechanical properties.
  \ The proposed program focuses on developing advanced silicone coatings by working
  with a manufacturer of coated and laminated fabrics for industrial and general-purpose
  applications.  In Phase I, we will develop coating formulations, deposit coatings
  on a few different types of fabrics, and characterize the coatings for various properties
  that are required for airbag applications.  Additionally, plans for commercialization
  and scale-up will be developed during Phase I for implementation in Phase II, so
  that the product can be manufactured and marketed in Phase III.\",\n\t\"license_title\":
